import React from "react";
import { Tabs, Tab } from "react-mdl";

class SignUpIn extends React.Component {
  constructor(props) {
    super(props);
    this.state = { activeTab: 0 };
    this.html = "";
  }

  handleTabChange = (event) => {
    console.log(event);
    if (event === 0) {
      console.log("this is sign up");

      return <p> Sign Up</p>;
      //   return (
      //     <div className="content">
