      //             <br />
      //             <input type="submit" />
      //           </form>
      //         </div>
      //       </div>
      //     </div>
      //   );
    } else if (event === 1) {
      console.log("this is sign in");
      return <p> Hi!</p>;
    }
  };

  render() {
    return (
      <div className="demo-tabs">
        <Tabs
          activeTab={this.state.activeTab}
          onChange={(tabId) => this.setState({ activeTab: tabId })}
          ripple
          onChange={(tabId) => this.handleTabChange(tabId)}
        >
          <Tab>Sign Up</Tab>
          <Tab>Sign In</Tab>
        </Tabs>
        <section>
          <div>{this.html}</div>
        </section>
      </div>
    );
  }
}

export default SignUpIn;
